{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/yerbolatalaidar/bellabeat-case-study?scriptVersionId=106109824\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"31dda757","metadata":{"papermill":{"duration":0.022934,"end_time":"2022-09-20T11:56:16.504533","exception":false,"start_time":"2022-09-20T11:56:16.481599","status":"completed"},"tags":[]},"source":["---\n","  title: \"Bellabeat_CaseStudy\"\n","author: \"Yerbolat\"\n","date: \"2022-09-06\"\n","output:\n","  pdf_document: default\n","html_document: default\n","---"]},{"cell_type":"markdown","id":"f4c585d5","metadata":{"papermill":{"duration":0.020737,"end_time":"2022-09-20T11:56:16.545849","exception":false,"start_time":"2022-09-20T11:56:16.525112","status":"completed"},"tags":[]},"source":[" # Case Study: How Can a Wellness Technology Company Play It Smart?\n","  \n","  **Bellabeat** is high-tech manufacturer of health-focused products **for women**. Bellabeat is a successful small company, but they have the potential to become a larger player in the global **smart device** market. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company. \n","I have been asked to focus on one of **Bellabeat’s** products and **analyze smart device** data to **gain insight** into how consumers are using their smart devices. The insights you discover will then help **guide marketing strategy** for the company. I will present my analysis to the Bellabeat executive team along with high-level recommendations for **Bellabeat’s** marketing strategy.\n","\n","### Stakeholders:\n","\n","* **Urška Sršen**: Bellabeat’s cofounder and Chief Creative Officer \n","* **Sando Mur**: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","* **Bellabeat marketing analytics team**: A team of data analysts responsible for collecting, analyzing, and\n","reporting data that helps guide Bellabeat’s marketing strategy.\n","\n","### Products:\n","* **Bellabeat app**: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. \n","* **Leaf**: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","* **Time**: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your\n","daily wellness.\n","* **Spring**: This is a water bottle that tracks daily water intake using smart technology to ensure that you are\n","appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your\n","hydration levels.\n","* **Bellabeat membership**: Bellabeat also offers a subscription-based membership program for users. Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on their lifestyle and goals.\n","\n","## Step 1 **ASK phase**\n","\n","#### 1.1 Business task:\n","\n","Bellabeat product and analyze smart device usage data in order to gain insight into how people are already using their smart devices. Then, using this information, make high-level recommendations for how these trends can inform Bellabeat marketing strategy.\n","Analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smart devices. Select one Bellabeat product to apply these insights to presentation.\n","\n","#### 1.2 Business objectives:\n","\n","1. What are some trends in smart device usage?\n","  2. How could these trends apply to Bellabeat customers?\n","  3. How could these trends help influence Bellabeat marketing strategy?\n","  \n","  #### 1.3 Primary Stakeholders:\n","  \n","  * **Urška Sršen**: Bellabeat’s cofounder and Chief Creative Officer \n","* **Sando Mur**: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","* **Bellabeat marketing analytics team**: A team of data analysts responsible for collecting, analyzing, and\n","reporting data that helps guide Bellabeat’s marketing strategy.\n","\n","#### 1.4 \"Products:\n","* **Bellabeat app**: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. \n","* **Leaf**: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","* **Time**: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your\n","daily wellness.\n","* **Spring**: This is a water bottle that tracks daily water intake using smart technology to ensure that you are\n","appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your\n","hydration levels.\n","* **Bellabeat membership**: Bellabeat also offers a subscription-based membership program for users. Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on their lifestyle and goals.\n","\n","\n","## Step 2 **Prepare phase**\n","\n","#### 2.1 Information about Data:\n","* External \n","* Quantitative(discrete and continuous data)\n","* Big\n","1. The **FitBit Fitness Tracker Data** is imported from external sources. For more information, click [here](https://www.kaggle.com/datasets/arashnic/fitbit)\n","2. Dataset made available through [Mobius](https://www.kaggle.com/arashnic) under CC0: Public Domain License.\n","3. This Kaggle data set contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users’ habits\n","3. Data contain different type of date such as integer, float, date, datetime.And,  the data set have both long and wide tables.\n","4. The data is not private. It is open, accessible data.\n","\n","#### 2.2 Limitations of data \n","\n","1. The data was collected by respondents to a distributed survey via Amazon Mechanical Turk. Therefore data may have sample bias.\n","2. Data for the period from 2015-04-12 to 2016-05-12. First data was collected only month and data is outdated(6 years ago). For this reason data is not relevant and reliable. \n","3. Data is third-party data that collected with FitBit Fitness Tracker from its users. \n","4. In the dataset isn't specified gender of users. Bella beat products only for women. Accordingly the colcusion would be limited prediction. \n","5.The dataset does not have metadata, elements can have different measurments, distance is in the mile or killometer, weight in the kg orlbs. The data is not consistent.\n","6. The age is not specified in the data, we cannot predict the range of the age segment of people. •\n","\n","#### 2.3 Does the data ROCCC?\n","\n","1. Reliable - medium. The dataset is accurate, but it have some sample bias.\n","2. Original -medium.Data come from official sources. But I am not sure this data 100% original, because it is third-party data. \n","3. Comprehensive-medium.The data have a lot of information which can provide insights for business task.\n","4. Current-low. The data is outdated, already for this survey was 6 year. \n","5. Cited-medium. It is unknown. \n","\n","#### 2.4 Storing data\n","Downloaded the archived 18 csv files.\n","\n","## Step 3 Process phase\n","I renamed the files and unzipped csv files, deleting only the last word \"merged\". The rest of the name is readable. \n","\n","#### 3.1 Preparing the data\n","I splitted datetime column in the files to date and time separately besides big files(doesn't support big above 10 million cells), because R studio would read like character data type.And uploaded files to R studio. \n","\n","#### 3.2 Preparing the packages for work with dataset\n","I install the packages like \"tidyverse\".\n"]},{"cell_type":"code","execution_count":1,"id":"1b17a007","metadata":{"execution":{"iopub.execute_input":"2022-09-20T11:56:16.591856Z","iopub.status.busy":"2022-09-20T11:56:16.58868Z","iopub.status.idle":"2022-09-20T11:56:34.196817Z","shell.execute_reply":"2022-09-20T11:56:34.195006Z"},"papermill":{"duration":17.633778,"end_time":"2022-09-20T11:56:34.199707","exception":false,"start_time":"2022-09-20T11:56:16.565929","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.1 \n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2      \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2 \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mf