ime":"2022-09-20T11:57:07.056591","exception":false,"start_time":"2022-09-20T11:57:06.99941","status":"completed"},"tags":[]},"source":["We see that on Monday and Saturday users sleep the most, the least on Friday, Tuesday,Wednesday."]},{"cell_type":"markdown","id":"fd7c1f8b","metadata":{"papermill":{"duration":0.057199,"end_time":"2022-09-20T11:57:07.171464","exception":false,"start_time":"2022-09-20T11:57:07.114265","status":"completed"},"tags":[]},"source":["## Step 6 Act \n","\n","\n","1. What are some trends in smart device usage?\n","\n","* The majority users take sedentary lifestyle. The average sedentary minute 991.2=16.5 hours. \n","* About half of the users spent around 3 hours awake in bed before falling asleep, which indicates sleep difficulties, and explains why users sleep less than the recommended time.\n","* The average total steps per day is 7638. This is below the recommended 10,000 steps for adults.\n","\n","2. How could these trends apply to Bellabeat customers? \n","\n","We need directly women's data about their activities to give specific insights. But this data from Fitbit users, therefore ,these ideas are also relevant. We can apply for Bellabeat's users. \n","\n","3. How could these trends help influence Bellabeat marketing strategy?\n","\n","* We can create campaign for people who take sedentary lifestyle. Emphasize the features of Bellabeat related to reminding them of physical activity during the day.\n","* A most od people have sleep difficulties, and we can explain why they can't sleep well and show them Bellabeat's features how it can remind them about sleeping.  \n","* Bellabeat could track users steps and remind them about their goal. Notify them haven't done the daily goal steps yet. \n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters